import React from 'react'
import classes from './Header.module.css';
function Header() {
    return (
        <div>
            <div id='header' className={classes.Header}>
                <div className='container'>
                    <div id='mobile_menu'>
                      hi
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Header
